import React from "react";
import data from "../data";


function TopMovies() {
  return (
    <div>
        <h1 className="top-title">Top Movies</h1>
        <div className="movies-list">
        {
          data.movies.map(movie =>
              <div className="movie">
                <img className="movie-image" src={movie.backgroundImg} alt="imagem de capa do filme" />
                <div className="movie-name">{movie.title}</div>
              </div>
          ).slice(0, 5)
        }
      </div>  
    </div>
  );
}

export default TopMovies;
